import React, { useContext } from 'react';
import { AuthContext } from '../../../context/AuthContext';
import { NavLink } from 'react-router-dom';
import { Button } from '@material-ui/core';


export default function GeneralNavLinks() {

   const {isLoggedIn} = useContext(AuthContext);

    return (
        <React.Fragment>
            { !auth.isLoggedIn &&  <NavLink to="/user/login"><Button color="inherit">Login</Button></NavLink> }         
            { !isLoggedIn  && <NavLink to="/user/signup"><Button color="inherit">signup</Button></NavLink> }
            { !isLoggedIn  && <NavLink to="/admin/adminlogin"><Button color="inherit">Admin</Button></NavLink> }
            { !isLoggedIn && <NavLink to={"/books/" + null} ><Button color="inherit">All Books</Button></NavLink> }
        </React.Fragment>
    )
}
